  }
]
function App() {
  class Field extends React.Component{
    constructor(props){
      super(props);
      this.state = {
        name: this.props.name,
        child: this.props.child
      }
    }

    render(){
      var subs = this.state.child.map((namu) => <h5>{namu}</h5>)
      return (
        <h1>{this.state.name}</h1>
      );
    }
  }
}

export default App;
